import React, { useState } from 'react';
import axios from 'axios';
import Swal from 'sweetalert2';

const Register = () => {
    const [formData, setFormData] = useState({
        usuario: {
            login: '',
            password: ''
        },
        persona: {
            primerNombre: '',
            segundoNombre: '',
            primerApellido: '',
            segundoApellido: '',
            email: '',
            fechaNacimiento: '',
            identificacion: '',
            ubicacion: {
                direccion: '',
                municipio: '',
                departamento: ''
            }
        }
    });

    const handleChange = (event) => {
        const { name, value } = event.target;
        const keys = name.split('.'); // Para manejar la estructura anidada del formData

        if (keys.length === 2) {
            // Actualiza el campo de 'usuario'
            setFormData((prevData) => ({
                ...prevData,
                [keys[0]]: {
                    ...prevData[keys[0]],
                    [keys[1]]: value
                }
            }));
        } else if (keys.length === 3) {
            // Actualiza el campo de 'persona.ubicacion'
            setFormData((prevData) => ({
                ...prevData,
                [keys[0]]: {
                    ...prevData[keys[0]],
                    [keys[1]]: {
                        ...prevData[keys[0]][keys[1]],
                        [keys[2]]: value
                    }
                }
            }));
        } else {
            // Actualiza el campo de 'persona'
            setFormData((prevData) => ({
                ...prevData,
                [name]: value
            }));
        }
    };

    const handleSubmit = async (event) => {
        event.preventDefault();

        try {
            await axios.post('http://localhost:9001/Laboratorio1/persona', formData);
            Swal.fire({
                title: 'Éxito',
                text: 'Registro completado correctamente.',
                icon: 'success'
            });
            // Limpiar el formulario después del registro
            setFormData({
                usuario: {
                    login: '',
                    password: ''
                },
                persona: {
                    primerNombre: '',
                    segundoNombre: '',
                    primerApellido: '',
                    segundoApellido: '',
                    email: '',
                    fechaNacimiento: '',
                    identificacion: '',
                    ubicacion: {
                        direccion: '',
                        municipio: '',
                        departamento: ''
                    }
                }
            });
        } catch (error) {
            // Manejar error según el tipo de error
            if (error.response) {
                const { status, data } = error.response;

                // Mensajes específicos basados en el estado de la respuesta
                let errorMessage;
                if (status === 409) {
                    errorMessage = data; // Aquí se espera que data contenga el mensaje del backend
                    Swal.fire({
                        title: 'Error',
                        text: errorMessage,
                        icon: 'error'
                    });
                } else {
                    Swal.fire({
                        title: 'Error',
                        text: 'Ocurrió un error en el registro.',
                        icon: 'error'
                    });
                }
            } else {
                Swal.fire({
                    title: 'Error',
                    text: 'Ocurrió un error en la conexión.',
                    icon: 'error'
                });
            }
        }
    };

    return (
        <div className="container">
            <h2>Registro de Usuario</h2>
            <form onSubmit={handleSubmit}>
                <div className="form-group">
                    <label htmlFor="usuario.login">Nombre de Usuario</label>
                    <input
                        type="text"
                        className="form-control"
                        id="usuario.login"
                        name="usuario.login"
                        value={formData.usuario.login}
                        onChange={handleChange}
                        required
                    />
                </div>
                <div className="form-group">
                    <label htmlFor="usuario.password">Contraseña</label>
                    <input
                        type="password"
                        className="form-control"
                        id="usuario.password"
                        name="usuario.password"
                        value={formData.usuario.password}
                        onChange={handleChange}
                        required
                    />
                </div>
                <div className="form-group">
                    <label htmlFor="persona.primerNombre">Primer Nombre</label>
                    <input
                        type="text"
                        className="form-control"
                        id="persona.primerNombre"
                        name="persona.primerNombre"
                        value={formData.persona.primerNombre}
                        onChange={handleChange}
                        required
                    />
                </div>
                <div className="form-group">
                    <label htmlFor="persona.segundoNombre">Segundo Nombre</label>
                    <input
                        type="text"
                        className="form-control"
                        id="persona.segundoNombre"
                        name="persona.segundoNombre"
                        value={formData.persona.segundoNombre}
                        onChange={handleChange}
                    />
                </div>
                <div className="form-group">
                    <label htmlFor="persona.primerApellido">Primer Apellido</label>
                    <input
                        type="text"
                        className="form-control"
                        id="persona.primerApellido"
                        name="persona.primerApellido"
                        value={formData.persona.primerApellido}
                        onChange={handleChange}
                        required
                    />
                </div>
                <div className="form-group">
                    <label htmlFor="persona.segundoApellido">Segundo Apellido</label>
                    <input
                        type="text"
                        className="form-control"
                        id="persona.segundoApellido"
                        name="persona.segundoApellido"
                        value={formData.persona.segundoApellido}
                        onChange={handleChange}
                    />
                </div>
                <div className="form-group">
                    <label htmlFor="persona.email">Correo Electrónico</label>
                    <input
                        type="email"
                        className="form-control"
                        id="persona.email"
                        name="persona.email"
                        value={formData.persona.email}
                        onChange={handleChange}
                        required
                    />
                </div>
                <div className="form-group">
                    <label htmlFor="persona.fechaNacimiento">Fecha de Nacimiento</label>
                    <input
                        type="date"
                        className="form-control"
                        id="persona.fechaNacimiento"
                        name="persona.fechaNacimiento"
                        value={formData.persona.fechaNacimiento}
                        onChange={handleChange}
                        required
                    />
                </div>
                <div className="form-group">
                    <label htmlFor="persona.identificacion">Identificación</label>
                    <input
                        type="text"
                        className="form-control"
                        id="persona.identificacion"
                        name="persona.identificacion"
                        value={formData.persona.identificacion}
                        onChange={handleChange}
                        required
                    />
                </div>
                <h4>Ubicación</h4>
                <div className="form-group">
                    <label htmlFor="persona.ubicacion.direccion">Dirección</label>
                    <input
                        type="text"
                        className="form-control"
                        id="persona.ubicacion.direccion"
                        name="persona.ubicacion.direccion"
                        value={formData.persona.ubicacion.direccion}
                        onChange={handleChange}
                        required
                    />
                </div>
                <div className="form-group">
                    <label htmlFor="persona.ubicacion.municipio">Municipio</label>
                    <input
                        type="text"
                        className="form-control"
                        id="persona.ubicacion.municipio"
                        name="persona.ubicacion.municipio"
                        value={formData.persona.ubicacion.municipio}
                        onChange={handleChange}
                        required
                    />
                </div>
                <div className="form-group">
                    <label htmlFor="persona.ubicacion.departamento">Departamento</label>
                    <input
                        type="text"
                        className="form-control"
                        id="persona.ubicacion.departamento"
                        name="persona.ubicacion.departamento"
                        value={formData.persona.ubicacion.departamento}
                        onChange={handleChange}
                        required
                    />
                </div>
                <button type="submit" className="btn btn-primary">Registrar</button>
            </form>
        </div>
    );
};

export default Register;
